-- DROP SCHEMA NEXT_COLA_OLTP; 

CREATE SCHEMA NEXT_COLA_OLTP;
USE NEXT_COLA_OLTP;

CREATE TABLE Supplier (
    SupplierID INT PRIMARY KEY,
    Name VARCHAR(255),
    ContactInfo VARCHAR(255),
    Address VARCHAR(255),
    Country VARCHAR(50),
    Email VARCHAR(255),
    Phone VARCHAR(20),
    Rating DECIMAL(3, 2),
    ContractStartDate DATE,
    ContractEndDate DATE
);

CREATE TABLE PurchaseOrder (
    OrderID INT PRIMARY KEY,
    SupplierID INT,
    OrderDate DATE,
    TotalAmount DECIMAL(10, 2),
    Status VARCHAR(50),
    PaymentMethod VARCHAR(50),
    PaymentStatus VARCHAR(50),
    ExpectedDeliveryDate DATE,
    ActualDeliveryDate DATE,
    Comments VARCHAR(255),
    FOREIGN KEY (SupplierID) REFERENCES Supplier(SupplierID)
);



CREATE TABLE Manufacturer (
    ManufacturerID INT PRIMARY KEY,
    Name VARCHAR(255),
    ContactInfo VARCHAR(255),
    Address VARCHAR(255),
    Country VARCHAR(50),
    Email VARCHAR(255),
    Phone VARCHAR(20)
);

CREATE TABLE Category (
    CategoryID INT PRIMARY KEY,
    Name VARCHAR(255),
    Description VARCHAR(255)
);

CREATE TABLE Product (
    ProductID INT PRIMARY KEY,
    Name VARCHAR(255),
    Description VARCHAR(255),
    Price DECIMAL(10, 2),
    CategoryID INT,
    ManufacturerID INT,
    StockLevel INT,
    ReorderLevel INT,
    Discontinued BOOLEAN,
    FOREIGN KEY (CategoryID) REFERENCES Category(CategoryID),
    FOREIGN KEY (ManufacturerID) REFERENCES Manufacturer(ManufacturerID)
);

CREATE TABLE PurchaseOrderDetail (
    OrderID INT,
    ProductID INT,
    Quantity INT,
    UnitPrice DECIMAL(10, 2),
    Discount DECIMAL(5, 2),
    Tax DECIMAL(5, 2),
    TotalAmount DECIMAL(10, 2),
    DeliveryStatus VARCHAR(50),
    PRIMARY KEY (OrderID, ProductID),
    FOREIGN KEY (OrderID) REFERENCES PurchaseOrder(OrderID),
    FOREIGN KEY (ProductID) REFERENCES Product(ProductID)
);

CREATE TABLE Location (
    LocationID INT PRIMARY KEY,
    Name VARCHAR(255),
    Address VARCHAR(255),
    PostalCode VARCHAR(20),
    Country VARCHAR(50),
    Region VARCHAR(50),
    City VARCHAR(50),
    Latitude DECIMAL(9, 6),
    Longitude DECIMAL(9, 6)
);


CREATE TABLE Department (
    DepartmentID INT PRIMARY KEY,
    Name VARCHAR(255),
    ManagerID INT,
    LocationID INT,
    Budget DECIMAL(10, 2)
);


CREATE TABLE Employee (
    EmployeeID INT PRIMARY KEY,
    Name VARCHAR(255),
    ContactInfo VARCHAR(255),
    DepartmentID INT,
    RoleID INT,
    HireDate DATE,
    Salary DECIMAL(10, 2),
    Commission DECIMAL(5, 2),
    ManagerID INT
);


CREATE TABLE Warehouse (
    WarehouseID INT PRIMARY KEY,
    LocationID INT,
    Capacity INT,
    ManagerID INT,
    OpeningHours VARCHAR(255),
    ClosingHours VARCHAR(255),
    ContactInfo VARCHAR(255),
    FOREIGN KEY (LocationID) REFERENCES Location(LocationID),
    FOREIGN KEY (ManagerID) REFERENCES Employee(EmployeeID)
);

CREATE TABLE Inventory (
    ProductID INT,
    WarehouseID INT,
    Quantity INT,
    MinimumStockLevel INT,
    MaximumStockLevel INT,
    ReorderPoint INT,
    LastReorderDate DATE,
    ExpectedDeliveryDate DATE,
    PRIMARY KEY (ProductID, WarehouseID),
    FOREIGN KEY (ProductID) REFERENCES Product(ProductID),
    FOREIGN KEY (WarehouseID) REFERENCES Warehouse(WarehouseID)
);

CREATE TABLE Customer (
    CustomerID INT PRIMARY KEY,
    Name VARCHAR(255),
    ContactInfo VARCHAR(255),
    Address VARCHAR(255),
    Email VARCHAR(255),
    Phone VARCHAR(20),
    PreferredPaymentMethod VARCHAR(50),
    CreditLimit DECIMAL(10, 2),
    AccountStatus VARCHAR(50)
);

	CREATE TABLE Shipment (
		ShipmentID INT PRIMARY KEY,
		WarehouseID INT,
		OrderID INT,
		ShipmentDate DATE,
		EstimatedArrivalDate DATE,
		ActualArrivalDate DATE,
		Status VARCHAR(50),
		Carrier VARCHAR(50),
		TrackingNumber VARCHAR(50),
		FOREIGN KEY (WarehouseID) REFERENCES Warehouse(WarehouseID),
		FOREIGN KEY (OrderID) REFERENCES PurchaseOrder(OrderID)
	);

CREATE TABLE ShipmentDetail (
    ShipmentID INT,
    ProductID INT,
    Quantity INT,
    UnitPrice DECIMAL(10, 2),
    Discount DECIMAL(5, 2),
    Tax DECIMAL(5, 2),
    TotalAmount DECIMAL(10, 2),
    PRIMARY KEY (ShipmentID, ProductID),
    FOREIGN KEY (ShipmentID) REFERENCES Shipment(ShipmentID),
    FOREIGN KEY (ProductID) REFERENCES Product(ProductID)
);


CREATE TABLE SalesOrder (
    OrderID INT PRIMARY KEY,
    CustomerID INT,
    OrderDate DATE,
    TotalAmount DECIMAL(10, 2),
    Status VARCHAR(50),
    PaymentMethod VARCHAR(50),
    PaymentStatus VARCHAR(50),
    ExpectedDeliveryDate DATE,
    ActualDeliveryDate DATE,
    FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID)
);

CREATE TABLE SalesOrderDetail (
    OrderID INT,
    ProductID INT,
    Quantity INT,
    UnitPrice DECIMAL(10, 2),
    Discount DECIMAL(5, 2),
    Tax DECIMAL(5, 2),
    TotalAmount DECIMAL(10, 2),
    DeliveryStatus VARCHAR(50),
    PRIMARY KEY (OrderID, ProductID),
    FOREIGN KEY (OrderID) REFERENCES SalesOrder(OrderID),
    FOREIGN KEY (ProductID) REFERENCES Product(ProductID)
);

CREATE TABLE Returns (
    ReturnID INT PRIMARY KEY,
    OrderID INT,
    CustomerID INT,
    ReturnDate DATE,
    Reason VARCHAR(255),
    RefundAmount DECIMAL(10, 2),
    RefundMethod VARCHAR(50),
    RefundStatus VARCHAR(50),
    Comments VARCHAR(255),
    FOREIGN KEY (OrderID) REFERENCES SalesOrder(OrderID),
    FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID)
);

CREATE TABLE ReturnDetail (
    ReturnID INT,
    ProductID INT,
    Quantity INT,
    UnitPrice DECIMAL(10, 2),
    Discount DECIMAL(5, 2),
    Tax DECIMAL(5, 2),
    TotalAmount DECIMAL(10, 2),
    PRIMARY KEY (ReturnID, ProductID),
    FOREIGN KEY (ReturnID) REFERENCES Returns(ReturnID),
    FOREIGN KEY (ProductID) REFERENCES Product(ProductID)
);

CREATE TABLE Payment (
    PaymentID INT PRIMARY KEY,
    OrderID INT,
    PaymentMethod VARCHAR(255),
    PaymentDate DATE,
    Amount DECIMAL(10, 2),
    Status VARCHAR(50),
    ConfirmationNumber VARCHAR(50),
    FOREIGN KEY (OrderID) REFERENCES SalesOrder(OrderID)
);



